import React, { useEffect } from 'react';
import './wasm/add.js';

function Demo() {
  useEffect(() => {
    // Ensure the add.wasm file is loaded
    window.Module['wasmBinaryFile'] = process.env.PUBLIC_URL + '/add.wasm';

    // Initialize the Module
    window.Module['onRuntimeInitialized'] = () => {
      // Get a reference to the _add function
      const add = window.Module.cwrap('add', 'number', ['number', 'number']);

      // Call the _add function and print the result
      const result = add(2, 3);
      console.log(result); // Output: 5
    };

    // Handle errors
    window.Module['onAbort'] = (error) => {
      console.log('Error caught: ', error);
    };
  }, []);

  return (
    <div>
      <h1>WebAssembly Demo</h1>
    </div>
  );
}

export default Demo;
